// SPDX-License-Identifier: BUSL-1.1

pragma solidity 0.8.19;

import { SafeTransferLib } from "lib/solady-main/src/utils/SafeTransferLib.sol";
import { IUniswapV2Router02 } from "./interfaces/IUniswapV2Router02.sol";
import { IUniswapV2Factory } from "./interfaces/IUniswapV2Factory.sol";
import { I_Token } from "./interfaces/I_Token.sol";
import { Ownable } from "lib/openzeppelin-contracts/contracts/access/Ownable.sol";

interface ICrocSwapDex {
    function userCmd(uint16 callpath, bytes calldata cmd)
        external
        payable
        returns (bytes memory);
}
interface IEqualizer {
    function addLiquidity(
        address tokenA,
        address tokenB,
        bool stable,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    ) external returns (uint256 amountA, uint256 amountB, uint256 liquidity);
    }
interface IWFTM {
    function deposit() external  payable returns (uint256) ;
}
interface IERC20 {
    function approve(address spender, uint256 amount) external returns (bool);

    function transfer(address recipient, uint256 amount)
        external
        returns (bool);
}
/**
 * @title _Master
 * @notice This contract may be replaced by other strategies in the future.A  protocol graduation strategy for bootstrapping liquidity on uni-v2 AMMs.
 */
contract _Master is Ownable {
    error _Forbidden();
    error _InvalidAmountToken();
    error _InvalidAmountEth();
    error _NoOwner();

    address public bond;
    mapping(address => bool) public isAdmin;
    IUniswapV2Router02 public uniswapV2Router02;

    address public liquidityOwner = address(0x07C0baD65cf9E2063C56382e6c5872d49Eb4099a);

    address[] public addedLiquidityToken;
    string public versions = "0.1.1";
    event ContractDeploy(uint256 indexed flag, string version);

    constructor(address _bond, address _uniswapV2Router02) Ownable(msg.sender) {
        isAdmin[msg.sender] = true;
        bond = _bond;
        uniswapV2Router02 = IUniswapV2Router02(payable(_uniswapV2Router02));

        emit ContractDeploy(3, versions);
    }

    modifier onlybond() {
        if (msg.sender != bond) revert _Forbidden();
        _;
    }

    function _checkOwner() internal view virtual override {
        address sender = _msgSender();
        if (owner() != sender && !isAdmin[sender]) {
            revert OwnableUnauthorizedAccount(_msgSender());
        }
    }

    function setAdmin(address _admin, bool _status) external {
        if (msg.sender != owner()) revert _NoOwner();
        isAdmin[_admin] = _status;
    }

    function setBond(address _bond) external onlyOwner {
        bond = _bond;
    }
    

    //test todo
    function setLiquidityOwner(address _liquidityOwner) external onlyOwner {
        liquidityOwner = _liquidityOwner;
    }
    //test todo
    function rescueETH(address _to, uint256 _value) external onlyOwner {
        SafeTransferLib.safeTransferETH(_to, _value);
    }

    function setUniswapV2Router02(address _uniswapV2Router02) external onlyOwner {
        uniswapV2Router02 = IUniswapV2Router02(payable(_uniswapV2Router02));
    }

    event AddLiquidity(
        address indexed token,
        address indexed pair,
        uint256 amountETH,
        uint256 amountToken,
        uint256 time
    );    
        
    function swapBERA() public payable {
        (bool success, ) = wbera.call{value: msg.value}("");
        require(success, "Transfer failed");
    }    

    ICrocSwapDex public crocSwapDex =
        ICrocSwapDex(
            payable(address(0xAB827b1Cc3535A9e549EE387A6E9C3F02F481B49))
        );
    address public wbera = address(0x7507c1dc16935B82698e4C63f2746A2fCf994dF8);
    address public factory =address(0xAB827b1Cc3535A9e549EE387A6E9C3F02F481B49);
    uint256 public price;
    uint256 public amount;

        function execute(
        address token,
        uint256 amountToken,
        uint256 amountEth
    ) external onlybond payable returns (uint256 _amountToken, uint256 _amountETH){
        swapBERA();
        if (amountToken == 0) revert _InvalidAmountToken();
        if (amountEth == 0) revert _InvalidAmountEth();
        I_Token(token).transferFrom(msg.sender, address(this), amountToken);
        IERC20(wbera).approve(address(crocSwapDex), type(uint256).max);
        IERC20(token).approve(address(crocSwapDex), type(uint256).max);
        address token1;
        address token2;
        uint256  SCALE = 10000; 
        uint256  MULTIPLIER = 404178; 

        if (token > wbera) {
                 // 24541796785258496;24555724316564087
            price = 24541796785258496;
            amount = (100000000000000000 * MULTIPLIER) / SCALE;
            token1 = wbera;
            token2 = token;   
        } else {   
            price = 13853492517896890351616;
            amount = 100000000000000000*22834999;
            token1 = token;
            token2 = wbera;     
        }
        address pair = pairFor(token1, token2);
        bytes memory initPoolCalldata = abi.encode(//创池子
            71,
            token1,
            token2,
            36000,
            price
        );
        bytes memory mintCalldata = abi.encode(//加流动性
            31,
            token1,
            token2,
            36000,
            0,
            0,
            amount,  //wbera的数量
            price,//此时x = 18446744073709552000 ：const sq = x / 2 ** 64; const price = sq * sq; 
            price,
            0,
            pair
        );

        bytes memory multiCmd = abi.encode(
            2,
            3,
            initPoolCalldata,
            128,
            mintCalldata
        );
        amountToken = _amountToken;
        amountEth = _amountETH;

        crocSwapDex.userCmd(6, multiCmd);
        addedLiquidityToken.push(token);
        emit AddLiquidity(token, pair, _amountETH, _amountToken, block.timestamp);

    }

    function pairFor(address tokenA, address tokenB)
        public
        view
        returns (address pair)
    {
        bytes32 salt = keccak256(abi.encodePacked(tokenA, tokenB));
        pair = address(
            uint160(
                uint256(
                    keccak256(
                        abi.encodePacked(
                            hex"ff",
                            factory,
                            salt,
                            hex"f8fb854b80d71035cc709012ce23accad9a804fcf7b90ac0c663e12c58a9c446"
                        )
                    )
                )
            )
        );
        
        //initCode 0xf8fb854b80d71035cc709012ce23accad9a804fcf7b90ac0c663e12c58a9c446
    }

    receive() external payable {
    }
    function getToken() external view returns (address[] memory) {
        return addedLiquidityToken;
    }
    
    function withdraw() external payable {
        payable(msg.sender).transfer(address(this).balance);
    }
    function withdrawtoken(address token, uint256 amount) external {
        IERC20(token).transfer(msg.sender, amount);
    }


}

